'''Waymottin''' is a gnome found in the [[Ape Atoll Dungeon]], near [[Zooknock]]. If you lose your [[10th squad sigil]] during [[Monkey Madness I]], [[Garkor]] will tell you to go to him for a new one. Waymottin has no other role in Monkey Madness. He can be found right in front of Zooknock trying to dig a tunnel through the wall with a spell. You can use the drop method to obtain multiple sigils from him. The only reason he is there is to give you a replacement sigil. During the earlier portions of Monkey Madness I, when you are not a member of the 10th squad, he will not talk to you.

